{ "type": "METADATA", "fields": { "media_id": "0DgeZjJtJ8EC", "caption": "Eine Statue der Justitia mit einer Waage und einem Schwert in ihren Händen.", "frame_capture:url": "https://example.com/thumbnails/thumb.0000031.jpg", "frame_capture:numerator": "1", "frame_capture:denominator": "5" }
} field description media_id alpha-numeric CMS id of the media caption the video's caption frame_capture:url if frame capture was enabled during transcoding, this is the URL of the last frame capture frame_capture:numerator frame capture images are numerated, starting at 0000000 which can be used as the poster image. frame_capture:denominator numerator and denominator can be used to to calculate which frame capture image must be displayed at a given time. Example: for numerator=1 and denominator=5, we have to increment the frame capture every 5 / 1 == 5 seconds: 00:00.000 --> 00:05.000
/thumbnails/thumb.0000000.jpg 00:05.000 --> 00:10.000
/thumbnails/thumb.0000001.jpg 00:10.000 --> 00:15.000
/thumbnails/thumb.0000002.jpg 00:15.000 --> 00:20.000
/thumbnails/thumb.0000003.jpg ... [~] [~]

70.body:
Message to provide parameters when requesting data for a section page, currently only the path of the page. Correct paths have a leading and a trailing slash, like /nachrichten/unterhaltung/ The homepage has the path /. message GetSectionPageRequest { // valid section_path, with leading and trailing slash string section_path = 1; // use to page through sections. If unspecified, it will default to `1`. // Paging is 1-based (1 is the first page, there is no page `0`) // // Due to underlying mechanisms and seo requirements, page-size is fixed at 30 // The service may return fewer than this value. int32 page = 2;
} [~] Response message when requesting data for a section page. Responds with NOT_FOUND if an unknown path is requested, or the path is incorrect. message GetSectionPageResponse {
stroeer.page.section.v1.SectionPage section_page = 1; // Total number of pages in this `section_path`
int32 total_pages = 2; PaginationType pagination_type = 3; enum PaginationType { // Not specified. PAGINATION_TYPE_UNSPECIFIED = 0; // The default pagination type. FIXED_BLOCK = 1; // Pagination type for Evergreen-Ressorts. GHOST_BLOCK = 2; }
} [~] Service to fetch all data needed to render a section page, like the homepage or "/politik/" [~]
